class Welcome extends CI_Controller {



	public function index()
	{
		
		$testCount=278;

		$ciphermode=['tripledes','des','aes-128','blowfish'];
		$mode=['cbc','cbc','cbc','cbc'];
		$keys=['2e051471984f8c112fa8ce60a21e','12e386739a81ae','19160cc19e494cc59565be51ec57924d','e2a6609c1175ce99f77cc5546f9a337b37945ac569be571c66e5c084820d3c0085d222d674b979f77a9a670fa18baa8374e1ed1da8f94c8a
		'];
		$data['keys']=$keys;

		for ($i=0; $i < 4; $i++) {

				$data['hmac_value'][$i]=$this->return_hmac_value($this->getText($i),$keys[$i]);
		for ($itest=0; $itest < 279; $itest++) {
				$data['rawtext'][$i][]=$this->getText($itest);

				$data['datacipher'][$i][]=$ciphermode[$i];
				// // encrypting process
				$this->benchmark->mark('code_start');
				$data['encryptedResult'][$i][]=$this->encrypt_decrypt_data($i,'encrypt',$ciphermode[$i],$mode[$i],$keys[$i],$this->getText($itest));
				$this->benchmark->mark('code_end');
				$data['encryptedTimeResult'][$i][] = $this->benchmark->elapsed_time('code_start', 'code_end');
				$data['encryptionByteResult'][$i][] = strlen(end($data['encryptedResult'][$i]));
				// decrypting process
				$this->benchmark->mark('code_start');
				$data['decryptedResult'][$i][]=$this->encrypt_decrypt_data($i,'decrypt',$ciphermode[$i],$mode[$i],$keys[$i],end($data['encryptedResult'][$i]));
				$this->benchmark->mark('code_end');
				$data['decryptedTimeResult'][$i][] = $this->benchmark->elapsed_time('code_start', 'code_end');
				$data['decryptedByteResult'][$i][] = strlen(end($data['decryptedResult'][$i]));
				
			}
		}

		
		 
		// //encryption average
		//Calculate the average.
		$data['encryptionAvg1'] = array_sum($data['encryptedTimeResult'][0]) / count($data['encryptedTimeResult'][0]);
		//Calculate the average.
		$data['encryptionAvg2'] = array_sum($data['encryptedTimeResult'][1]) / count($data['encryptedTimeResult'][1]);
		//Calculate the average.
		$data['encryptionAvg3'] = array_sum($data['encryptedTimeResult'][2]) / count($data['encryptedTimeResult'][2]);
		//Calculate the average.
		$data['encryptionAvg4'] = array_sum($data['encryptedTimeResult'][3]) / count($data['encryptedTimeResult'][3]);
		
		//decrtyption average 
		//Calculate the average.
		$data['decryptionAvg1'] = array_sum($data['decryptedTimeResult'][0]) / count($data['decryptedTimeResult'][0]);
		//Calculate the average.
		$data['decryptionAvg2'] = array_sum($data['decryptedTimeResult'][1]) / count($data['decryptedTimeResult'][1]);
		//Calculate the average.
		$data['decryptionAvg3'] = array_sum($data['decryptedTimeResult'][2]) / count($data['decryptedTimeResult'][2]);
		//Calculate the average.
		$data['decryptionAvg4'] = array_sum($data['decryptedTimeResult'][3]) / count($data['decryptedTimeResult'][3]);

		//ECHO JSON_ENCODE($data);

		//print_r(json_encode($data['rawtext'][1]));

		$this->load->view('welcome_message',$data);
	}

	public function encrypt(){
		$testCount=278;

		$ciphermode=['tripledes','des','aes-256','blowfish'];
		$mode=['cbc','cbc','cbc','cbc'];
		$keys=['2e051471984f8c112fa8ce60a21e','12e386739a81ae','19160cc19e494cc59565be51ec57924d','e2a6609c1175ce99f77cc5546f9a337b37945ac569be571c66e5c084820d3c0085d222d674b979f77a9a670fa18baa8374e1ed1da8f94c8a
		'];
		$i=$this->input->post('key');
		$itest=$this->input->post('testdatanum');

		$this->benchmark->mark('code_start');
		$data['encryptedResult'][$i][]=$this->encrypt_decrypt_data($i,'encrypt',$ciphermode[$i],$mode[$i],$keys[$i],$this->getText($itest));
		$this->benchmark->mark('code_end');

		ECHO JSON_ENCODE($data);
	}


	public function decrypt(){
		$testCount=278;

		$ciphermode=['tripledes','des','aes-256','blowfish'];
		$mode=['cbc','cbc','cbc','cbc'];
		$keys=['2e051471984f8c112fa8ce60a21e','12e386739a81ae','19160cc19e494cc59565be51ec57924d','e2a6609c1175ce99f77cc5546f9a337b37945ac569be571c66e5c084820d3c0085d222d674b979f77a9a670fa18baa8374e1ed1da8f94c8a
		'];
		$i=$this->input->post('key');
		$itest=$this->input->post('testdatanum');
		
		//$this->benchmark->mark('code_start');
		$ETEXT=$this->encrypt_decrypt_data($i,'encrypt',$ciphermode[$i],$mode[$i],$keys[$i],$this->getText($itest));
		//$this->benchmark->mark('code_end');

		$data['decryptedResult'][$i][]=$this->encrypt_decrypt_data($i,'decrypt',$ciphermode[$i],$mode[$i],$keys[$i],$ETEXT);

		ECHO JSON_ENCODE($data);
	}

		public function return_hmac_value($message,$key){
			return hash_hmac('sha512',$message,$key); 
		}

	public function encrypt_decrypt_data($num,$action,$cipher,$mode,$keys,$text){
	
			$this->load->library('encryption');
				$this->encryption->initialize(
					array(
							'cipher' => $cipher,
							'mode' => $mode,
							'key' => $keys
					)
				);
	
			$output = false;
			$encrypted_text = $this->encryption->encrypt($text);	
			if ( $action == 'encrypt' ) {
				$output = $this->encryption->encrypt($text);
			} else if( $action == 'decrypt' ) {
				$output = $this->encryption->decrypt($text);
			}

		 	return $output;
		 	
	}

